import React, { useState } from 'react';
import FeedGrid from '../components/FeedGrid';
import QuickBuyBar from '../components/QuickBuyBar';

export default function FeedPage() {
  const [buyAmount, setBuyAmount] = useState('0.01');
  const [showEditColumns, setShowEditColumns] = useState(false);
  return (
    <div className="min-h-screen bg-[#0f0f0f] px-6 py-10 text-white">
      <div className="flex items-center mb-8">
        <QuickBuyBar amount={buyAmount} onAmountChange={setBuyAmount} onEditColumns={() => setShowEditColumns(true)} />
      </div>
      <FeedGrid buyAmount={buyAmount} />
      {showEditColumns && (
        <div className="fixed inset-0 z-50 flex items-center justify-center bg-black/60">
          <div className="bg-zinc-900 rounded-2xl p-8 shadow-2xl border border-blue-500/30 min-w-[340px] max-w-[90vw]">
            <div className="flex justify-between items-center mb-4">
              <h2 className="text-xl font-bold text-blue-300">Edit Columns</h2>
              <button className="text-zinc-400 hover:text-red-400 text-lg font-bold" onClick={() => setShowEditColumns(false)}>âœ•</button>
            </div>
            <div className="text-zinc-400">(Column management UI goes here...)</div>
          </div>
        </div>
      )}
    </div>
  );
}
